import React from 'react'

function Menudisplay({data}) {
  return (
    <div key={data.id}>
      <a href={data.game_url} className="menulink"><div  style={{backgroundImage:`url(${data.thumbnail})`}} className="menuimg">
   </div></a>
    </div>
  )
}

export default Menudisplay
